INSERT INTO public.place (id, address, description, homepage, img_url, name, telephone, thumbnail_img_url) VALUES (1, '서울특별시 종로구 세종대로 175(세종로)', '오시는길<br>▶ 지하철<br>*1호선 시청역 하차- 3번 출구로 나오셔서 코리아나 호텔 방향으로 계속 걸어오시면세종문화회관을 만나실 수 있습니다.<br>*2호선 시청역 하차<br>- 3번 출구로 나오셔서 덕수궁을 지나 코리아나 호텔 방향으로 계속 걸어오시면 세종문화회관을 만나실 수 있습니다.<br>*3호선 경복궁역하차<br>- 6번, 7번 출구로 나오셔서 외환은행 방향으로 계속 걸어오시면 세종문화회관을 만나실 수 있습니다.<br>*5호선 광화문역하차<br>- 1번, 8번 출구로 나오시면 바로 세종문화회관을 만나실 수 있습니다.<br>▶버스<br>*세종문화회관 하차:<br>01 9602 0015 1-1 1011 150 162 1711 200 401 402 406 5001 5500 7018 7022 7023 704 9301<br>9400 9401 9402 9411 9600 9601 9706 9713 삼청마을버스<br>*한국통신앞 하차:<br>01 1-1 150 200 7020 삼청마을버스<br>*교보빌딩앞 하차:<br>0015 0212 1011 1020 162 606 7012 7018 9703 9704 9711 9712<br>*미국대사관앞 하차: 0015 0212 1012 1020 1711 5001 7012', 'http://www.sejongpac.or.kr/', 'http://ticketimage.interpark.com/Play/Place/00202.gif', '세종문화회관', '02-399-1114~6', 'http://ticketimage.interpark.com/Play/Place/00202.gif');
INSERT INTO public.place (id, address, description, homepage, img_url, name, telephone, thumbnail_img_url) VALUES (2, '서울특별시 서초구 서초동 700번지', '오시는길<br>▶ 지하철<br>*3호선 남부터미널역 5번 출구<br>- 도보이동 (약 5~10분 소요)<br>- 마을버스 22번(초록색)을 타고 두 정거장 이동<br>- 셔틀버스 이용 (마을버스와 동일한 경로)<br><br>*2호선 서초역 3번 출구<br>- 마을버스 11번(초록색)을 타고 네 정거장 이동<br>- 도보이동 (약 20~25분 소요)<br><br>*4호선 사당역 1번 출구<br>- 마을버스 17번(초록색)을 타고 16개 정거장 이동<br><br>▶ 버스<br><br>간선 406, 405<br>지선 5413<br>직행 1500-2, 1553<br>마을 서초11, 서초17, 서초22<br><br><셔틀버스 운행정보><br><br>운행노선<br>남부터미널역 5번출구 마을버스 정류장 승차 → 전당앞 스타벅스 하차<br>*마지막 버스는 음악당 주차장에서 하차합니다.<br><br>운행시간<br>평일 : 저녁 6시 30분 ~ 7시 30분<br>토·일·공휴일 : 오후 1시 30분 ~ 2시 30분 / 저녁 6시 30분 ~ 7시 30분<br>* 월요일과 공연없는 날에는 운행하지 않습니다.<br>* 오전 공연에는 운행하지 않습니다.<br><br>배차횟수<br>배차간격은 교통상황에 따라 변동됩니다.<br><br>승차장안내<br>관련 법규에 의거, 예술의전당 셔틀버스는 사설운행에 해당되어 도로변에 셔틀버스 이정표 설치나 버스정류장에 셔틀버스 안내문 부착이 불가함을 양지하여 주시기 바라며, 예술의전당 셔틀버스는 항상 남부터미널 5번 출구 마을버스 정류장에서 출발하오니 안심하시고 이용하시기 바랍나다', 'http://www.sac.or.kr', 'http://ticketimage.interpark.com/Play/Place/00020.gif', '예술의 전당', ' 02-580-1300', 'http://ticketimage.interpark.com/Play/Place/00020.gif');
INSERT INTO public.place (id, address, description, homepage, img_url, name, telephone, thumbnail_img_url) VALUES (3, '서울시 중구 퇴계로 387', '▶버스<br>◎ 파란(간선)버스<br>142, 147, 263, 302, 371 신당동 사거리(중부소방서)에서 하차<br>◎ 녹색(지선)버스<br>1017, 2012, 2014, 2015, 2233, 0211 신당동 사거리(중부소방서)에서 하차<br>◎ 빨간(광역)버스<br>9403 충무아트홀(중부소방서)에서 하차<br><br>▶지하철<br>◎ 지하철 6호선 신당역 9번 출입구 → 동대문역사문화공원 방향으로 50m<br>◎ 지하철 2호선 신당역 1번 출입구 → 동대문역사문화공원 방향으로 150m<br>◎ 지하철 2/4/5호선 동대문역사문화공원역 2번 출입구 → 신당역 사거리방향으로 300m<br><br>▶ 좌석수<br>-대극장 – 1,255석<br>-중극장 블랙 – 327석<br>-소극장 블루 - 230석', 'http://www.caci.or.kr', 'http://ticketimage.interpark.com/Play/Place/05000039.gif', '충무아트센터', '02-2230-6600', 'http://ticketimage.interpark.com/Play/Place/05000039.gif');
